import React from "react";
import NoteCard from "./NoteCard";

const NoteList = ({ notes }) => {
    return (
        <div className="row">
            {notes.map((note) => (
                <div className="col-md-4" key={note.id}>
                    <NoteCard note={note} />
                </div>
            ))}
        </div>
    );
};

export default NoteList;
